from typing import List

class Solution:
    def subarraysDivByK(self, nums: List[int], k: int) -> int:
        ''' Intuition:
            i   =  0   1   2   3   4   5
           nums = [4,  5,  0, -2, -3,  1]
           pfx  = [4,  9,  9,  7,  4,  5]
           rem  = [4,  4,  4,  2,  4,  0]
           If rem is the same at indices i and j, then nums[i+1:j+1] is divisible by k. <= make sure you understand the proof!!
           rem = 4 at inds 0 and 1, hence nums[1:2] or [5] is divisible by k
           rem = 4 at inds 0 and 2, hence nums[1:3] or [5,0] is divisible by k
           rem = 4 at inds 1 and 2, hence nums[2:3] or [0] is divisible by k
           rem = 4 at inds 0 and 4, hence nums[1:5] or [5,0,-2,-3] is divisible by k
           rem = 4 at inds 1 and 4, hence nums[2:5] or [0,-2,-3] is divisible by k
           ... and so on ...
           rem = 0 is a special case, handled by settings count[0] = 1
        '''
        N = len(nums)
        count = [1] + [0 for _ in range(k)]
        prefix_sum = 0
        res = 0
        for n in nums:
            prefix_sum += n
            ind = prefix_sum % k
            res += count[ind]
            count[ind] += 1
        return res

